import Vue from 'vue';
import VueRouter from 'vue-router';

Vue.use(VueRouter);

const routes = [
  {
    path: '/',
    component: () => import('./views/MainLayout.vue')
  },
  // Add more routes as needed
];

const router = new VueRouter({
  mode: 'history',
  routes
});

export default router;
